import React from 'react';

const Navbar = () => {
  return (
    <nav>
      <ul>
      <Link to='/' id='page_link'> Home</Link>
      <Link to='/AccountPage' id='page_link'> Account</Link>
        <li><a href="/">Home</a></li>
        <li><a href="/AccountPage">Account</a></li>
        <li><a href="/">Contact</a></li>
      </ul>
    </nav>
  );
}

export default Navbar;
